18-06-15 19:54:39','2018-06-15 17:54:39','',0,'http://localhost/projekt_koncowy/?p=22',3,'nav_menu_item','',0),(23,1,'2018-06-13 15:57:30','2018-06-13 13:57:30',' ','','','publish','closed','closed','','23','','','2018-06-15 19:54:39','2018-06-15 17:54:39','',0,'http://localhost/projekt_koncowy/?p=23',4,'nav_menu_item','',0),(24,1,'2018-06-13 15:57:30','2018-06-13 13:57:30',' ','','','publish','closed','closed','','24','','','2018-06-15 19:54:39','2018-06-15 17:54:39','',0,'http://localhost/projekt_koncowy/?p=24',5,'nav_menu_item','',0),(25,1,'2018-06-13 15:57:46','2018-06-13 13:57:46','Nazywam się Zofia Król. Ukończyłam psychologię na Katolickim Uniwersytecie Lubelskim. Posiadam uprawnienia do badań psychologicznych w zakresie psychologii transportu oraz uprawnienia do prowadzenia badań psychologicznych osób ubiegających się o broń lub posługujących się bronią. \r\nMam wieloletnie doświadczenie w zakresie psychologii transportu oraz psychologii pracy.','o mnie','','publish','closed','closed','','o-mnie','','','2018-06-24 13:46:22','2018-06-24 11:46:22','',0,'http://localhost/projekt_koncowy/?page_id=25',1,'page','',0),(26,1,'2018-06-13 15:57:46','2018-06-13 13:57:46','o Zosi','o mnie','','inherit','closed','closed','','25-revision-v1','','','2018-06-13 15:57:46','2018-06-13 13:57:46','',25,'http://localhost/projekt_koncowy/index.php/2018/06/13/25-revision-v1/',0,'revision','',0),(27,1,'2018-06-13 15:58:04','2018-06-13 13:58:04',' ','','','publish','closed','closed','','27','','','2018-06-15 19:54:39','2018-06-15 17:54:39','',0,'http://localhost/projekt_koncowy/?p=27',6,'nav_menu_item','',0),(29,1,'2018-06-13 16:19:08','2018-06-13 14:19:08','Prowadzę badania:\r\n<ul>\r\n 	<li>kierowców zawodowych oraz osób kierujących pojazdami w celach służbowych</li>\r\n 	<li>kierowców zawodowych w ramach wszystkich kategorii prawa jazdy (A, B, C, D, E) i prowadzących samochód w celach służbowych (np. przedstawicieli handlowych)</li>\r\n 	<li>kandydatów na kierowców (w ramach kat. A, B, C, D, E)</li>\r\n 	<li>kierowców pojazdów uprzywilejowanych i przewożących wartości pieniężne</li>\r\n 	<li>instruktorów i egzaminatorów nauki jazdy</li>\r\n 	<li>kandydatów na instruktorów i egzaminatorów</li>\r\n 	<li>kierowców taksówek</li>\r\n 	<li>kierowców rajdowych, wyścigowych, żużlowców</li>\r\n</ul>','badania kierowców zawodowych, kandydatów na kierowców, instruktorów, kierowców taksówek','','publish','closed','closed','','kierowcy-zawodowi','','','2018-06-24 12:22:40','2018-06-24 10:22:40','',0,'http://localhost/projekt_koncowy/?post_type=offer&#038;p=29',2,'offer','',0),(30,1,'2018-06-13 16:19:44','2018-06-13 14:19:44','Prowadzę badania osób, które zostały skierowane na badanie psychologiczne przez Policję/Prezydenta Miasta/Starostę w celu ustalenia istnienia lub braku przeciwwskazań psychologicznych do kierowania pojazdami.\r\n\r\nBadaniom psychotechnicznym (tzw. psychotestom) podlegają kierowcy:\r\n<ul>\r\n 	<li>skierowani w wyniku przekroczenia 24 punktów karnych</li>\r\n 	<li>prowadzący pojazd w stanie nietrzeźwości lub po użyciu środka działającego podobnie do alkoholu</li>\r\n 	<li>sprawcy wypadków drogowych, w następstwie których inna osoba poniosła śmierć lub doznała obrażeń</li>\r\n</ul>','badania kierowców, punkty karne, alkohol, wypadki','','publish','closed','closed','','kierowcy','','','2018-06-24 12:21:56','2018-06-24 10:21:56','',0,'http://localhost/projekt_koncowy/?post_type=offer&#038;p=30',1,'offer','',0),(31,1,'2018-06-13 16:20:33','2018-06-13 14:20:33','Wykonuję badania operatorów maszyn i pracowników pracujących na wysokości:\r\n<ul>\r\n 	<li>operatorów wózków widłowych</li>\r\n 	<li>operatorów żurawi wieżowych i samojezdnych</li>\r\n 	<li>operatorów suwnic sterowanych z kabiny i zdalnie sterowanych</li>\r\n 	<li>operatorów wszelkiego rodzaju sprzętu budowlanego, ciężkiego np. koparek, dźwigów, maszyn drogowych itp.</li>\r\n 	<li>operatorów pulpitów sterowniczych urządzeń technologicznych wielofunkcyjnych i wielozadaniowych</li>\r\n 	<li>operatorów sprzętu wymagającego specjalistycznych badań psychologicznych np. prace przy liniach napowietrznych niskich, średnich i wysokich napięć, prace przy remoncie i montażu sieci trakcyjnych,</li>\r\n 	<li>osób pracujących na wysokości pow. 3 m.</li>\r\n 	<li>i innych (zgodnie z Rozporządzeniem Ministra Pracy i Polityki Socjalnej z dnia 28 maja 1996 r.)</li>\r\n</ul>','badania operatorów oraz pracowników wysokościowych','','publish','closed','closed','','operatorzy','','','2018-06-24 13:14:34','2018-06-24 11:14:34','',0,'http://localhost/projekt_koncowy/?post_type=offer&#038;p=31',3,'offer','',0),(32,1,'2018-06-13 16:20:45','2018-06-13 14:20:45','Badania psychologiczne:\r\n<ul>\r\n 	<li>osób posługujących się bronią i starających się o pozwolenie na broń:\r\n<ul>\r\n 	<li class=\"sub-li\">bojową</li>\r\n 	<li class=\"sub-li\">myśliwską</li>\r\n 	<li class=\"sub-li\">sportową</li>\r\n 	<li class=\"sub-li\">kolekcjonerską</li>\r\n</ul>\r\n</li>\r\n 	<li>do nabywania oraz przechowywania materiałów wybuchowych</li>\r\n 	<li>do obrotu bronią i materiałami niebezpiecznymi</li>\r\n 	<li>do pracy detektywa czyli do wykonywania usług detektywistycznych</li>\r\n 	<li>do pracy inspektora transportu drogowego</li>\r\n 	<li>do pracy strażnika gminnego (miejskiego)</li>\r\n 	<li>komorników, kuratorów i sędziów, prokuratorów, syndyków</li>\r\n 	<li>pracowników ochrony</li>\r\n</ul>\r\n&nbsp;\r\n<p style=\"text-align: center;\">Badanie psychologiczne „na broń” obejmuje ocenę:</p>\r\n\r\n<ul>\r\n 	<li>poziomu umysłowego</li>\r\n 	<li>osobowości z uwzględnieniem funkcjonowania w sytuacjach trudnych</li>\r\n 	<li>poziomu dojrzałości społecznej i emocjonalnej</li>\r\n</ul>\r\n<strong>Uprawnienia do przeprowadzania badań psychologicznych osób ubiegających się o broń lub posługujących się bronią (nr uprawnień: 2/2018)</strong>','badania na broń','','publish','closed','closed','','bron','','','2018-06-24 13:15:11','2018-06-24 11:15:11','',0,'http://localhost/projekt_konco