margins\" data-page-id=\"page.21\"><section id=\"section4\" class=\" bd-section-46 bd-tagstyles\" data-section-title=\"One Сolumn\">\n<div class=\"bd-container-inner bd-margins clearfix\">\n<div class=\" bd-layoutcontainer-71 bd-columns bd-no-margins\">\n<div class=\"bd-container-inner\">\n<div class=\"container-fluid\">\n<div class=\"row bd-row-flex bd-row-align-middle\">\n<div class=\" bd-columnwrapper-195 col-lg-12 col-xs-6\">\n<div class=\"bd-layoutcolumn-195 bd-column\">\n<div class=\"bd-vertical-align-wrapper\">\n\nWykonuję badania operatorów maszyn i pracowników pracujących na wysokości:\n<ul>\n 	<li>Operatorów wózków widłowych</li>\n 	<li>Operatorów żurawi wieżowych i samojezdnych</li>\n 	<li>Operatorów suwnic sterowanych z kabiny i zdalnie sterowanych</li>\n 	<li>Operatorów wszelkiego rodzaju sprzętu budowlanego, ciężkiego np. koparek, dźwigów, maszyn drogowych itp.</li>\n 	<li>Operatorów pulpitów sterowniczych urządzeń technologicznych wielofunkcyjnych i wielozadaniowych</li>\n 	<li>Operatorów sprzętu wymagającego specjalistycznych badań psychologicznych np. prace przy liniach napowietrznych niskich, średnich i wysokich napięć, prace przy remoncie i montażu sieci trakcyjnych,</li>\n 	<li>Osób pracujących na wysokości pow. 3 m.</li>\n 	<li>I innych (zgodnie z Rozporządzeniem Ministra Pracy i Polityki Socjalnej z dnia 28 maja 1996 r.)</li>\n</ul>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</section></div>\n</div>\n</div>','badania operatorów oraz pracowników wysokościowych','','inherit','closed','closed','','31-autosave-v1','','','2018-06-24 12:24:47','2018-06-24 10:24:47','',31,'http://localhost/projekt_koncowy/?p=99',0,'revision','',0),(100,1,'2018-06-23 16:10:19','2018-06-23 14:10:19','a:7:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:9:\"post_type\";s:8:\"operator\";s:2:\"==\";s:5:\"value\";s:5:\"offer\";}}}s:8:\"position\";s:6:\"normal\";s:5:\"style\";s:7:\"default\";s:15:\"label_placement\";s:3:\"top\";s:21:\"instructio