p-content/uploads/2018/06/badania-kierowca.jpeg',0,'attachment','image/jpeg',0),(104,1,'2018-06-23 17:26:34','2018-06-23 15:26:34','','pexels-photo-620332','','inherit','open','closed','','pexels-photo-620332','','','2018-06-23 17:26:34','2018-06-23 15:26:34','',29,'http://localhost/projekt_koncowy/wp-content/uploads/2018/06/pexels-photo-620332.jpeg',0,'attachment','image/jpeg',0),(105,1,'2018-06-23 17:27:42','2018-06-23 15:27:42','','digger-machine-machinery-construction-162639','','inherit','open','closed','','digger-machine-machinery-construction-162639','','','2018-06-23 17:27:42','2018-06-23 15:27:42','',31,'http://localhost/projekt_koncowy/wp-content/uploads/2018/06/digger-machine-machinery-construction-162639.jpeg',0,'attachment','image/jpeg',0),(106,1,'2018-06-23 17:29:37','2018-06-23 15:29:37','','gun-revolver-fire-firing-370202','','inherit','open','closed','','gun-revolver-fire-firing-370202','','','2018-06-23 17:29:37','2018-06-23 15:29:37','',32,'http://localhost/projekt_koncowy/wp-content/uploads/2018/06/gun-revolver-fire-firing-370202.jpeg',0,'attachment','image/jpeg',0),(107,1,'2018-06-23 17:31:34','2018-06-23 15:31:34','','pexels-photo-376729','','inherit','open','closed','','pexels-photo-376729','','','2018-06-23 17:31:34','2018-06-23 15:31:34','',30,'http://localhost/projekt_koncowy/wp-content/uploads/2018/06/pexels-photo-376729.jpeg',0,'attachment','image/jpeg',0),(108,1,'2018-06-24 10:40:16','2018-06-24 08:40:16','<p class=\" bd-textblock-217 bd-content-element\">Badania psychotechniczne kierowców - Psychotesty</p>\n\n<ul class=\" bd-textblock-218 bd-content-element\">\n 	<li>Kierowców zawodowych oraz osób kierujących pojazdami w celach służbowych</li>\n 	<li>kierowców zawodowych w ramach wszystkich kategorii prawa jazdy (A, B, C, D, E) i prowadzących samochód w celach służbowych (np. przedstawicieli handlowych)</li>\n 	<li>kandydatów na kierowców (w ramach kat. A, B, C, D, E)</li>\n 	<li>kierowców pojazdów uprzywilejowanych i przewożących wartości pieniężne</li>\n 	<li>instruktorów i egzaminatorów nauki jazdy</li>\n 	<li>kandydatów na instruktorów i egzaminatorów</li>\n 	<li>kierowców taksówek</li>\n 	<li>kierowców rajdowych, wyścigowych, żużlowców</li>\n</ul>','badania kierowców zawodowych, kandydatów na kierowców, instruktorów, kierowców taksówek','','inherit','closed','closed','','29-autosave-v1','','','2018-06-24 10:40:16','2018-06-24 08:40:16','',29,'http://localhost/projekt_koncowy/?p=108',0,'revision','',0),(109,1,'2018-06-24 12:21:22','2018-06-24 10:21:22','Prowadzę badania osób, które zostały skierowane na badanie psychologiczne przez Policję/Prezydenta Miasta/Starostę w celu ustalenia istnienia lub braku przeciwwskazań psychologicznych do kierowania pojazdami.\n\nBadaniom psychotechnicznym (tzw. psychotestom) podlegają kierowcy:\n\nskierowani w wyniku przekroczenia 24 punktów karnych\nprowadzący pojazd w stanie nietrzeźwości lub po użyciu środka działającego podobnie do alkoholu\nsprawcy wypadków drogowych, w następstwie których inna osoba poniosła śmierć lub doznała obrażeń','badania kierowców, punkty karne, alkohol, wypadki','','inherit','closed','closed','','30-autosave-v1','','','2018-06-24 12:21:22','2018-06-24 10:21:22','',30,'http://localhost/projekt_koncowy/?p=109',0,'revision','',0),(110,1,'2018-06-24 13:10:48','2018-06-24 11:10:48','Badania psychologiczne:\n<ul>\n 	<li>Osób posługujących się bronią i starających się o pozwolenie na broń:\n<ul>\n 	<li style=\"list-style-type: none;\">\n<ul>\n 	<li class=\"sub-li\">bojową</li>\n 	<li class=\"sub-li\">myśliwską</li>\n 	<li class=\"sub-li\">sportową</li>\n 	<li class=\"sub-li\">kolekcjonerską</li>\n</ul>\n</li>\n</ul>\n</li>\n 	<li>do nabywania oraz przechowywania materiałów wybuchowych</li>\n 	<li>do obrotu bronią i materiałami niebezpiecznymi</li>\n 	<li>do pracy detektywa czyli do wykonywania usług detektywistycznych</li>\n 	<li>do pracy inspektora transportu drogowego</li>\n 	<li>do pracy strażnika gminnego (miejskiego)</li>\n 	<li>komorników, kuratorów i sędziów, prokuratorów, syndyków</li>\n 	<li>pracowników ochrony</li>\n</ul>\n&nbsp;\n<p style=\"text-align: center;\">Badanie psychologiczne „na broń” obejmuje ocenę:</p>\n\n<ul>\n 	<li>poziomu umysłowego</li>\n 	<li>osobowości z uwzględnieniem funkcjonowania w sytuacjach trudnych</li>\n 	<li>poziomu dojrzałości społecznej i emocjonalnej</li>\n</ul>\n<strong>Uprawnienia do przeprowadzania badań psychologicznych osób ubiegających się o broń lub posługujących się bronią (nr uprawnień: 2/2018)</strong>','badania na broń','','inherit','closed','closed','','32-autosave-v1','','','2018-06-24 13:10:48','2018-06-24 11:10:48','',32,'http://localhost/projekt_koncowy/?p=110',0,'revision','',0),(111,1,'2018-06-24 13:46:22','2018-06-24 11:46:22','Nazywam się Zofia Król. Ukończyłam psychologię na Katolickim Uniwersytecie Lubelskim. Posiadam uprawnienia do badań psychologicznych w zakresie psychologii transportu oraz uprawnienia do prowadzenia badań psychologicznych osób ubiegających się o broń lub posługujących się bronią. \r\nMam wieloletnie doświadczenie w zakresie psychologii transportu oraz psychologii pracy.','o mnie','','inherit','closed','closed','','25-revision-v1','','','2018-06-24 13:46:22','2018-06-24 11:46:22','',25,'http://localhost/projekt_koncowy/?p=111',0,'revision','',0),(112,1,'2018-06-24 15:32:06','2018-06-24 13:32:06','<p>This is the WPForms preview page. All your form previews will be handled on this page.</p><p>The page is set to private, so it is not publicly accessible. Please do not delete this page :) .</p>','WPForms Preview','','private','closed','closed','','wpforms-preview','','','2018-06-24 15:32:06','2018-06-24 13:32:06','',0,'http://192.168.0.16/projekt_koncowy/?page_id=112',0,'page','',0),(113,1,'2018-06-24 15:32:57','2018-06-24 13:32:57','{\"id\":\"113\",\"field_id\":2,\"fields\":{\"1\":{\"id\":\"1\",\"type\":\"text\",\"label\":\"Single Line Text\",\"description\":\"\",\"size\":\"medium\",\"placeholder\":\"\",\"default_value\